B.b3W=new A.bY("Praktikoje da\u017eniau naudojami suglausti puslaidininkiai, BOLD[[kuri\u0173 vienai daliai b\u016bdingas p laidumas, o kitai \u2014 n laidumas. \u0160i\u0173 dali\u0173 kontaktas vadinamas pn sand\u016bra.]] Ji pakei\u010dia kr\u016bvinink\u0173 i\u0161sid\u0117stym\u0105 kiekviename i\u0161 suglaust\u0173 puslaidininki\u0173.|N_6|Jeigu toks puslaidininkis yra ne\u012fjungtas \u012f elektros grandin\u0119, kai kurie elektronai pereina \u012f p srit\u012f, o kai kurios skyl\u0117s - \u012f n srit\u012f. CBLU[[Taip puslaidininki\u0173 sand\u016bra \u012fsielektrina ir atsiranda elektrinis laukas, kuris trukdo laisviesiems elektronams ir skyl\u0117ms toliau skverbtis \u012f prie\u0161ingas sritis.]]",!1,16,null)
B.b3X=new A.bY("BOLD[[Dyzeliniai varikliai]] veikia beveik taip pat, jie i\u0161 esm\u0117s skiriasi tik tuo, BOLD[[kad neturi u\u017edegimo \u017evak\u0117s]].|N_1|CBLU[[Cilindre susl\u0117gtas oras \u012fkaista iki 500\u2014 700 \xb0C. Nuo jo savaime suspaudimo takto pabaigoje u\u017esiliepsnoja dideliu sl\u0117giu \u012fpurk\u0161ti \u012f cilindr\u0105 degalai.]]",!1,16,null)
B.b3Y=new A.bY("Praktikoje laidininkai retai jungiami grandin\u0117je vien nuosekliai arba vien lygiagre\u010diai. Toje pa\u010dioje grandin\u0117je da\u017enai derinamas lygiagretusis ir nuoseklusis laidinink\u0173 jungimas.",!1,16,null)
